import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class SalaryService {

  constructor(private http: HttpClient) { }


  response:any;



  GetData() {
    this.http.get('http://localhost:5204/weatherforecast').subscribe({
      next: (response) => {
        console.log('data recieved', response)
      }
    })
  }

  PostData(form:any){
    debugger;
    this.http.post('http://localhost:5204/Salary/IncreaseSalaryCalc',form},{observe:"response"}).
          subscribe({

            next: (res)=>{
              console.log(res.body as any)
            },
            error: (err)=>{
              console.error(err)
            },
            complete:()=>{
              console.log("data retrived successfully")
            }

          })

  }


}
